

-- Table structure for `migrations`
CREATE TABLE `migrations` (`id` INT NOT NULL, `migration` varchar NOT NULL, `batch` INT NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `users`
CREATE TABLE `users` (`id` INT NOT NULL, `name` varchar NOT NULL, `email` varchar NOT NULL, `email_verified_at` datetime DEFAULT NULL, `password` varchar NOT NULL, `remember_token` varchar DEFAULT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL, `two_factor_secret` TEXT DEFAULT NULL, `two_factor_recovery_codes` TEXT DEFAULT NULL, `two_factor_confirmed_at` datetime DEFAULT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `password_reset_tokens`
CREATE TABLE `password_reset_tokens` (`email` varchar NOT NULL, `token` varchar NOT NULL, `created_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `sessions`
CREATE TABLE `sessions` (`id` varchar NOT NULL, `user_id` INT NOT NULL, `ip_address` varchar NOT NULL, `user_agent` TEXT NOT NULL, `payload` TEXT NOT NULL, `last_activity` INT NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `cache`
CREATE TABLE `cache` (`key` varchar NOT NULL, `value` TEXT NOT NULL, `expiration` INT NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `cache_locks`
CREATE TABLE `cache_locks` (`key` varchar NOT NULL, `owner` varchar NOT NULL, `expiration` INT NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `jobs`
CREATE TABLE `jobs` (`id` INT NOT NULL, `queue` varchar NOT NULL, `payload` TEXT NOT NULL, `attempts` INT NOT NULL, `reserved_at` INT NOT NULL, `available_at` INT NOT NULL, `created_at` INT NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `job_batches`
CREATE TABLE `job_batches` (`id` varchar NOT NULL, `name` varchar NOT NULL, `total_jobs` INT NOT NULL, `pending_jobs` INT NOT NULL, `failed_jobs` INT NOT NULL, `failed_job_ids` TEXT NOT NULL, `options` TEXT NOT NULL, `cancelled_at` INT NOT NULL, `created_at` INT NOT NULL, `finished_at` INT NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `failed_jobs`
CREATE TABLE `failed_jobs` (`id` INT NOT NULL, `uuid` varchar NOT NULL, `connection` TEXT NOT NULL, `queue` TEXT NOT NULL, `payload` TEXT NOT NULL, `exception` TEXT NOT NULL, `failed_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `personal_access_tokens`
CREATE TABLE `personal_access_tokens` (`id` INT NOT NULL, `tokenable_type` varchar NOT NULL, `tokenable_id` INT NOT NULL, `name` varchar NOT NULL, `token` varchar NOT NULL, `abilities` TEXT NOT NULL, `last_used_at` datetime NOT NULL, `expires_at` datetime NOT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `customers`
CREATE TABLE `customers` (`id` INT NOT NULL, `email` varchar NOT NULL, `active` tinyint(1) NOT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `categories`
CREATE TABLE `categories` (`id` INT NOT NULL, `name` varchar NOT NULL, `slug` varchar NOT NULL, `active` tinyint(1) NOT NULL, `promoted` tinyint(1) NOT NULL, `parent_id` INT, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `products`
CREATE TABLE `products` (`id` INT NOT NULL, `slug` varchar NOT NULL, `name` varchar NOT NULL, `image` varchar NOT NULL, `image_mime` varchar NOT NULL, `image_size` INT NOT NULL, `description` VARCHAR(247) NOT NULL, `active` tinyint(1) NOT NULL, `category_id` INT NOT NULL, `deleted_at` datetime DEFAULT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `variations`
CREATE TABLE `variations` (`id` INT NOT NULL, `category_id` INT NOT NULL, `name` varchar NOT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `variation_options`
CREATE TABLE `variation_options` (`id` INT NOT NULL, `variation_id` INT NOT NULL, `value` varchar NOT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `product_items`
CREATE TABLE `product_items` (`id` INT NOT NULL, `product_id` INT NOT NULL, `quantity` INT NOT NULL, `image` varchar NOT NULL, `image_mime` varchar NOT NULL, `image_size` INT NOT NULL, `active` tinyint(1) NOT NULL, `price` numeric NOT NULL, `deleted_at` datetime DEFAULT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `product_configurations`
CREATE TABLE `product_configurations` (`product_item_id` INT NOT NULL, `variation_option_id` INT NOT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `customer_details`
CREATE TABLE `customer_details` (`id` INT NOT NULL, `customer_id` INT NOT NULL, `first_name` varchar NOT NULL, `last_name` varchar NOT NULL, `address_line_one` varchar NOT NULL, `address_line_two` varchar NOT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `order_products`
CREATE TABLE `order_products` (`id` INT NOT NULL, `order_id` INT NOT NULL, `product_item_id` INT NOT NULL, `quantity` INT NOT NULL, `price_per_item` numeric NOT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `settings`
CREATE TABLE `settings` (`id` INT NOT NULL, `key` varchar NOT NULL, `value` varchar NOT NULL, `created_at` datetime DEFAULT NULL, `updated_at` datetime DEFAULT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `returns`
CREATE TABLE `returns` (`id` INT NOT NULL, `order_id` INT NOT NULL, `return_number` varchar NOT NULL, `status` varchar NOT NULL, `reason` TEXT NOT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `orders`
CREATE TABLE `orders` (`id` INT NOT NULL, `order_number` varchar NOT NULL, `customer_details_id` INT NOT NULL, `total_price` numeric NOT NULL, `status` varchar NOT NULL, `order_notes` TEXT NOT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL, `deleted_at` datetime NOT NULL, `return_id` INT NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `return_items`
CREATE TABLE `return_items` (`id` INT NOT NULL, `return_id` INT NOT NULL, `product_item_id` INT NOT NULL, `quantity` INT NOT NULL, `return_condition` TEXT NOT NULL, `return_notes` TEXT NOT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL, `deleted_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `telescope_entries`
CREATE TABLE `telescope_entries` (`sequence` INT NOT NULL, `uuid` varchar NOT NULL, `batch_id` varchar NOT NULL, `family_hash` varchar DEFAULT NULL, `should_display_on_index` tinyint(1) NOT NULL, `type` varchar NOT NULL, `content` LONGTEXT NOT NULL, `created_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `telescope_entries_tags`
CREATE TABLE `telescope_entries_tags` (`entry_uuid` varchar NOT NULL, `tag` varchar NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `telescope_monitoring`
CREATE TABLE `telescope_monitoring` (`tag` varchar NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `payments`
CREATE TABLE `payments` (`id` INT NOT NULL, `order_id` INT NOT NULL, `payment_method` varchar NOT NULL, `transaction_id` varchar NOT NULL, `status` varchar NOT NULL, `amount` numeric NOT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `shipments`
CREATE TABLE `shipments` (`id` INT NOT NULL, `order_id` INT NOT NULL, `tracking_number` varchar NOT NULL, `carrier` varchar NOT NULL, `status` varchar NOT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table structure for `order_logs`
CREATE TABLE `order_logs` (`id` INT NOT NULL, `order_id` INT NOT NULL, `action` varchar NOT NULL, `description` TEXT NOT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;